pragma solidity ^0.8.7;

contract EtherWallet{
    address payable owner;

    error OverWithdrawal(uint256 amount, uint256 balance);
    event WithdrawalSuccessful(string success_msg);
    event ContractDeployed(string message);

    constructor() payable {
        owner = payable(msg.sender);
        emit ContractDeployed("Contract deployed");
    }

    receive() external payable{}

    fallback() external payable{}

    function withdraw(address recipient, uint256 amount) external{

        require(msg.sender == owner, "Caller is not owner");

        uint256 contractBalance = address(this).balance;
        require(contractBalance >= amount, "Withdrawal amount is higher than wallet balance");
        payable(recipient).call{value:amount}("");

        emit WithdrawalSuccessful("Withdrawal successful");
    }

    function getBalance() external  returns(uint256) {
        return address(this).balance;
    }

}
